import React, {Component} from 'react';

class Article extends Component {
   componentDidMount() {
      fetch('https://jsonplaceholder.typicode.com/posts')
     .then(res => res.json())
     .then(data => console.log(data));

   }


   render (){
      return (
         <div>
            <p> hello world </p>
         </div>
      )
   }
}


export default Article;
